Override example:

protected override bool OnAddItem(object collection, object item)
{
    if (collection is C1NavigationListItemBaseCollection)
    {
        ((C1NavigationListItemBaseCollection)collection).Add((C1NavigationListItemBase)item);
        return true;
    }
    return false;
}

Override example:

protected override bool OnClearItems(object collection)
{
    if (collection is C1NavigationListItemBaseCollection)
    {
        ((C1NavigationListItemBaseCollection)collection).Clear();
        return true;
    }
    return false;
}

remarks.code:
LicenseInfo _licInfo;
public LicensedControl()
{
  // check license but don't nag yet
  _licInfo = ProviderInfo.Validate(typeof(LicensedControl), this, false);

  // perform licensing after control is fully loaded
  Loaded += LicensedControl_Loaded;
}
void LicensedControl_Loaded(object sender, RoutedEventArgs e)
{
  // nag after loading
  if (_licInfo.ShouldNag)
  {
    ProviderInfo.ShowAboutBox(this);
  }
}
